export const ArtworkPageTombstoneFragmentDoc = gql`
    fragment ArtworkPageTombstone on Artwork {
  title
  year
  material
  duration
  description(format: HTML)
  dimensions {
    inches {
      to_s
    }
    centimeters {
      to_s
    }
  }
}
    `;
export const ArtworkPageDocument = gql`
    query ArtworkPage($id: ID!) {
  artwork(id: $id) {
    id
    title
    intent
    images(state: PUBLISHED) {
      resized(width: 1125, height: 1125) {
        width
        height
        urls {
          _1x
          _2x
        }
      }
    }
    ...ArtworkPageTombstone
  }
}
    ${ArtworkPageTombstoneFragmentDoc}`;

